    name: "Seorin",
    location: "Daejeon",
    favorList: ["Icecream", "Fruits", "Bread"]
  };

  return (
    <div className="App">
      <Header />
      <Body {...BodyProps} />
      <Footer />
    </div>
  );
}

export default App;
